INSERT INTO `contacts` (`id`, `fullname`, `customer_id`, `email`, `phone`, `message`, `in_charge`, `status`, `image1`, `created_at`, `updated_at`) VALUES
(0000000001, '', 'EDR-0009', 'kasimsheyi20@gmail.com', '289382983982', 'India’s The Hindu newspaper has reported the death of three Nigerians in a rented accommodation in Uttam Nagar area of New Delhi. The Nigerians were found dead on Friday, with the police recovering bottles of alcohol and soft drinks from the spot.\n\n \n\nThe Times of India said all the three men were found frothing in the mouth.  Deputy Commissioner of Police (Dwarka) Shibesh Singh said the deceased have been identified as David Christopher, Greece Ben, and David (I), all in their 30s. While Greece used to live on the third floor of the rented accommodation, David used to reside on the second. David (I) had rented a house nearby but used to visit the two often.', 'Superadmin', 'In Progress', , '2018-05-16 13:22:57', '2018-06-02 13:38:21');
INSERT INTO `contacts` (`id`, `fullname`, `customer_id`, `email`, `phone`, `message`, `in_charge`, `status`, `image1`, `created_at`, `updated_at`) VALUES
(0000000002, '', 'EDR-0009', 'nelokwaz@gmail.com', '874387347378', 'India’s The Hindu newspaper has reported the death of three Nigerians in a rented accommodation in Uttam Nagar area of New Delhi. The Nigerians were found dead on Friday, with the police recovering bottles of alcohol and soft drinks from the spot.\n\n \n\nThe Times of India said all the three men were found frothing in the mouth.  Deputy Commissioner of Police (Dwarka) Shibesh Singh said the deceased have been identified as David Christopher, Greece Ben, and David (I), all in their 30s. While Greece used to live on the third floor of the rented accommodation, David used to reside on the second. David (I) had rented a house nearby but used to visit the two often.', 'Superadmin', NULL, , '2018-05-16 13:30:57', '2018-06-02 13:38:26');
