(00000000001, 'Goldeen Orphanage Ajah', 'India’s The Hindu newspaper has reported the death of three Nigerians in a rented accommodation in Uttam Nagar area of New Delhi. The Nigerians were found dead on Friday, with the police recovering bottles of alcohol and soft drinks from the spot.\r\n\r\n \r\n\r\nThe Times of India said all the three men were found frothing in the mouth.  Deputy Commissioner of Police (Dwarka) Shibesh Singh said the deceased have been identified as David Christopher, Greece Ben, and David (I), all in their 30s. While Greece used to live on the third floor of the rented accommodation, David used to reside on the second. David (I) had rented a house nearby but used to visit the two often.', 'goldenorphanage.com.ng', 7, '2018-06-02 12:16:04', '2018-07-03 14:51:37', 'images/1530615097.jpeg', '+2347057646248', 'what you need to know'),
