(0000000003, 'READY TO MINGLE MOVIES AND THEATRE PHOTOGRAPHY THE AFFINITY FAM', 'Empower Her Conference 2.0', 'With more than 16 Million girls within the age bracket of 15 to 19 years becoming mothers (WHO) and many more being discriminated, stereotyped and denied qualitative education, it is no longer a speculation that females face lots of barriers to unleashing their power. It is in this light that Empower Her Conference 2017 was initiated.\r\n\r\nThe Empower Her Conference is the second phase of the Empower Her Project where Girls, Girl Child advocates, mentors, advocates and concerned individuals converge to discuss a thematic painstaking challenge or issue affecting the Girl Child, proffering practical & action oriented solutions to these problems and allowing the girls to speak out and express themselves freely.', 'Onikan Youth Center, Obalende, Lagos', '10000', NULL, '07/14/2018 12:00 AM ', '2017-11-20 12:45:25', '2018-07-15 06:46:13', 'images/1531421620.png', 'Superadmin', 'Superadmin', '9-0', ' 07/14/2018 11:59 PM', 'Paid', '', '12,000'),
