(0000000001, 'FOOTBALL FANS', 'Superadmin', 'Football is a popular sport with a huge fan base and in this group we acknowledge and appreciate that. Come join us, meet up with fans who also have the same passion for soccer as you. Get the chance to watch your favourite teams live and interact with the players after matches.To top it up, you will get the chance to travel the world and witness the biggest football tournaments like the World Cup, AFCON, EPL, UEFA Champions league,etc', 'AD-000MA1', 'images/1515175722.jpeg', '2017-11-07 16:01:34', '2018-05-19 08:06:12', 'Superadmin'),
(0000000003, 'DANCE', 'Superadmin', 'Dance is a performing art form consisting of purposefully selected sequences of human movement. This movement has aesthetic and symbolic value and is acknowledged as Dance by performers and observers within a particular culture. If you’d love to learn how to salsa, quickstep, waltz, break dance, ballet or you have a preference for the local trending steps like shoki, shaku shaku, etc we’ve got you covered.', 'AD-000MA1', 'images/1515691411.jpeg', '2017-11-13 13:16:58', '2018-01-11 16:23:34', 'Superadmin'),
(0000000004, 'FOODIES', 'Superadmin', 'Food lovers get ready to experience a burst of flavours, explore diverse menus and recipes, and discover various traditional and continental delicacies across the globe. Brace yourselves for the cook-offs, improve your cooking skills, and learn how to prepare dishes you never thought you could. Also, learn how to make your meals look mouth watering by garnishing and serving meals to a world-class standard. What are you waiting for? Come join us!', 'AD-000MA1', 'images/1516003957.jpeg', '2017-11-28 09:43:16', '2018-01-30 12:31:19', 'Superadmin'),
(0000000005, 'SPORTS', 'Superadmin', 'Calling on my sports stars! Are you ready to exhibit your skills and your love for sports? You don’t want to miss out on the various games we’ve got lined up for you like basketball, volleyball, golf, soccer, table and lawn tennis, squash, swimming, etc. It’s not a problem if you do not know how to play as our professional coaches will be on hand to teach you so you can improve your skills and someday you too can shine among the sports stars in the world. There will be competitions and also opportunities to meet and greet sportswomen and men who have made it in the sports industry.', 'AD-000MA1', 'images/1511866072.jpeg', '2017-11-28 09:47:55', '2018-01-17 11:56:02', 'Superadmin'),
(0000000006, 'COUPLES', 'Superadmin', 'Are you married or in a relationship? Prepare to be entertained and have new fun experiences with your partner. Get ready to meet and mingle with other couples, have a wow experience travelling with other couples, learn your partner\'s strengths and weaknesses through the mental and physical games that we’ve got lined up. Also, different marriage counsellors will be on board to advise couples on how to spice up their relationships and rekindle the romance.', 'AD-000MA1', 'images/1516613068.jpeg', '2017-11-28 09:56:42', '2018-01-22 08:24:32', 'Superadmin'),
(0000000007, 'TRAVEL AND ADVENTURE', 'Superadmin', 'Fill your life with adventure and new experiences locally and internationally. Get ready to travel the world with an amazing group of people, go hiking and camping, climb the tallest mountains, visit zoos and game resorts, learn new facts about animals that you never knew, go bungee jumping, the list is endless. Join us so we can see the world together!', 'AD-000MA1', 'images/1515778783.jpeg', '2017-11-28 10:01:45', '2018-01-12 16:39:46', 'Superadmin'),
(0000000008, 'FASHION AND STYLE', 'Superadmin', 'Hello fashionistas, come let\'s have fun and meet up with top local and international fashion moguls, learn about trending fashion styles and haute couture,  get styled by renowned stylists and attend exclusive fashion events. Who knows? You could just catch the ‘fashion fever’ and become the next big name in the fashion world.', 'AD-000MA1', 'images/1516279161.jpeg', '2017-11-28 10:07:30', '2018-01-18 11:39:28', 'Superadmin'),
(0000000009, 'MOTHERHOOD', 'Superadmin', 'Motherhood is a thing of joy so whether you are a mom or a mom-to-be, we’ve got something for you.  Come join us as we create amazing experiences for you on this beautiful journey. Connect with other moms and moms-to-be and share stories about your journey, learn healthy eating habits and tips as well as fun exercises from our team of professional medical and health instructors. We want to make this an educative and fun-filled journey as we prepare you for the delivery of your bundle of joy. You will also learn more about children and the best way to nurture them so they can grow up strong and healthy!', 'AD-000MA1', 'images/1516640912.jpeg', '2017-11-28 10:12:14', '2018-01-22 16:08:37', 'Superadmin'),
(0000000010, 'NIGHT OWL', 'Superadmin', 'Shout out to all my party people, this is where you belong! Are you looking for trending hangouts, exclusive clubs, bars and lounges? Perhaps you don\'t have friends to go out and enjoy the nightlife with or you just want to party with a new crowd? Look no further as we’ve got you covered. Get in here and gain access to the rave-of-the-moment clubs, bars, lounges and mingle with other party lovers who are ready to turn up and give you a time of your life. Need I say more? Your nightlife is about to get super lit!', 'AD-000MA1', 'images/1516639417.jpeg', '2017-11-28 10:17:42', '2018-01-22 15:43:39', 'Superadmin'),
(0000000015, 'MUSIC HEADS', 'Superadmin', 'Get in here music lovers, we have everything for everyone! Check out different genres of music ranging from the old to the new school, pop, RnB, classics, hip-hop, rock, afrobeat and every other genre you can imagine. We will take you on a musical journey through time like you have never been on before. That’s not all, you can also learn to play any musical instruments of your choice like the cello, piano, guitar, trumpet, drums etc as well as participate in voice training sessions. Who knows? You could get inspired to become the next Beyonce with our team of world-class vocal trainers and instrumentalists at your service. We will even throw in music recording and production tips so you can start out on your journey of becoming the next big music producer in the music industry.', 'ANT0022', 'images/1516641885.jpeg', '2017-11-28 13:23:04', '2018-01-22 16:24:48', 'Superadmin'),
(0000000013, 'CULTURE AND LANGUAGES', 'Superadmin', 'Real communication of any kind requires cultural fluency and learning another language as an expression of that culture’s symbols and its understanding of the world. Learn about different cultures and languages of your choice and be able to communicate wherever you find yourself in any part of the world.  Have lots of fun learning about the different aspects of different cultures from languages to customs and traditions, arts and recreation, values and beliefs, food and traditional attires, etc.', 'AD-000MA1', 'images/1515170681.jpeg', '2017-11-28 11:17:59', '2018-01-11 09:06:07', 'Superadmin'),
(0000000014, 'CHARITIES AND VOLUNTEERING', 'Superadmin', 'Humanity is all about giving back and we are here for people like you who want to make a difference in the world. Join like-minded individuals who have a passion for compassion and community service to visit the orphanages, old people\'s homes, cancer centres and hospitals, organise fundraisers, donate food items and encourage the less privileged so that they feel loved. There are great rewards and tremendous power that comes with volunteering and charitable acts of kindness.', 'ANT0022', 'images/1513167493.jpeg', '2017-11-28 11:25:10', '2018-01-04 15:34:09', 'Superadmin'),
(0000000016, 'TECHIES', 'Superadmin', 'Are you computer and technology savvy? Well, this is the perfect place for you! Today, technology has become an essential part of our lives and very few can imagine living without it. As technology changes at a fast pace, we need to learn new skills at a much faster pace in order to stay up-to-date. Come and learn about the latest technologies on the horizon, software, devices and gadgets and exchange ideas with people who share the same interests as you. Technology just got interesting!', 'AD-000MA1', 'images/1513157377.jpeg', '2017-12-13 08:29:38', '2018-01-11 09:07:57', 'Superadmin'),
(0000000017, 'ENTREPRENEURSHIP', 'Superadmin', 'To all my independent hustlers, let’s shine like we’re supposed to. If you know that you’re a boss or you aspire to become your own boss someday, then this is where you should hang out and meet people who will inspire you to think outside the box. Rub minds with other pacesetters in various industries and get motivated through the sharing of ideas and experiences, learn tips on how to go about starting your own business and how to avoid common pitfalls in business. Information is power only when action is applied. Join us now and begin your journey to greatness. The sky is not your limit!', 'AD-000MA1', 'images/1513172379.jpeg', '2017-12-13 08:51:45', '2018-01-11 09:07:30', 'Superadmin'),
(0000000018, 'READY TO MINGLE', 'Superadmin', 'Tired of the single life and ready to mingle? Well, its time to get excited because you are one step closer to ditching this single life. Get connected with other interesting singles such as yourself and have great conversations, a good laugh and loads of fun with amazing people. Who knows? You could just find your soulmate! Don’t miss out on this wonderful opportunity.', 'AD-000MA1', 'images/1515171721.jpeg', '2017-12-13 09:03:46', '2018-01-11 09:08:23', 'Superadmin'),
(0000000019, 'ARTS AND CRAFT', 'Superadmin', 'To all my artistic minds what are you waiting for come lets paint nice,pictures of each other mould cups and sculpture,etc.Even if you can\'t you can learn from the best well known artist ,moulders,etc.Did i mention you get to go to all their exhibitions and even exhibit your own stuff oh and to the moulding and crafting factory were the pieces are put together to create amazing pieces.', 'AD-000MA1', 'images/1516009378.jpeg', '2017-12-13 09:35:18', '2018-01-15 08:43:02', 'Superadmin'),
(0000000020, 'FUN AND GAMES', 'Superadmin', 'Game lovers we have got you covered.  Come and have the best time of your life playing interesting games with fun people.  There’s a game for everyone from guessing games, card games, board games, video games, group games, outdoor games, etc. Let loose, come and be a part of the amazing experiences we have to offer.', 'AD-000MA1', 'images/1515168005.jpeg', '2017-12-14 07:52:53', '2018-01-11 09:09:13', 'Superadmin'),
(0000000021, 'MOVIES AND THEATRE', 'Superadmin', 'This is for all movie lovers who enjoy experiencing the thrill of action, suspense, horror, sci-fi, drama and the realisation of the day to day human struggles brought to life through moving, inspirational and powerful stage interpretations. If you have a flair for the cinematic, this is also for you. Let\'s mingle, share and enjoy the classics and the thrill of the latest and trending movies, experience the various relaxing and unique ambiences (indoors and outdoors) while enjoying exclusive themed and customised bites.', 'AD-000MA1', 'images/1515669268.jpeg', '2017-12-14 07:56:52', '2018-01-11 10:14:31', 'Superadmin'),
(0000000022, 'HEALTH', 'Superadmin', 'Health is wealth as the popular philosophy goes, there is no doubt that our number one priority should be living a healthy and well-balanced lifestyle. This group is all about broadening your understanding of how to maintain a healthy and sanitary lifestyle thereby improving immensely the quality of your living standards. Join us and exchange health tips, share ideas and interact with professionals in the field.', 'AD-000MA1', 'images/1516005897.jpeg', '2017-12-14 08:01:46', '2018-01-15 07:44:59', 'Superadmin'),
(0000000023, 'PHOTOGRAPHY', 'Superadmin', 'Photography is one of the arts that are thriving in the digital marketplace, with opportunities for employment both online and offline. So if you have a passion for photography, this is the right place for you. Learn the A-Z about photography and become the pro you aspire to be.', 'AD-000MA1', 'images/1516638386.jpeg', '2017-12-14 08:04:48', '2018-01-22 15:26:29', 'Superadmin'),
(0000000024, 'BOOKWORMS', 'Superadmin', 'Reading is a way of relaxing, building imagination, staying updated and knowledgeable about a lot of different experiences, cultures, countries and the world around you. Come and be a part of this intellectual and interesting group.  We offer a wide range of books to pick from. Get to meet amazing authors and learn how they get inspired to write best selling books.', 'AD-000MA1', 'images/1516628432.jpeg', '2017-12-14 08:19:45', '2018-01-22 12:40:35', 'Superadmin'),
(0000000025, 'THE AFFINITY FAM', 'Superadmin', 'Whats your affinity because we know ours this is where we get to meet with our clients and partners and indulging them in different topics ideas on how to improve the brand.We will get to hang out play games watch movies and do some dancing while we try to enjoy ourselves and have fun.', 'AD-000MA1', 'images/1516628719.png', '2017-12-15 09:46:28', '2018-01-22 12:45:21', 'Superadmin'),
(0000000026, 'BEACH LOVERS', 'Superadmin', 'Who else likes to chill out on the beach and get away from the hustle and bustle of city life? Well, if you are like me then what are you waiting for? Come, let’s mingle with other beach lovers and enjoy the beautiful sceneries mother nature has to offer, play games like beach soccer, volleyball, ride horses and enjoy mouthwatering barbeque at different beach locations across the country.', 'AD-000MA1', 'images/1515074526.jpeg', '2018-01-04 07:59:58', '2018-01-11 09:58:44', 'Superadmin'),
(0000000027, 'BEAUTY AND WELLBEING OF MEMBER', 'Superadmin', 'Beauty goes beyond the physical and is about being the best possible version of yourself on the inside as well as the outside while wellbeing is a state of comfort, health and happiness. Join us and get all the info, tips and tricks from our beauty and wellness experts on the latest skincare and beauty news, treatments and therapies, nutrition, makeup and many more.', 'AD-000MA1', 'images/1516042170.jpeg', '2018-01-15 10:44:20', '2018-07-11 06:53:45', 'Superadmin');
